import React from "react";

function Footer() {
  return (
    <footer id="footer">
      <p>&copy; 2025 최지은 포트폴리오. All Rights Reserved.</p>
      <p>Contact: jieun@example.com</p>
    </footer>
  );
}

export default Footer;
